import React from 'react';
import Nav from './Multi/Nav';
import './App.css';
import HeroS from './Main/herofocus3D';
import Home from './Main/Home.js';
// import Sports from './components/TOPICS/Sports.js';
// import Eco from './components/TOPICS/Eco.js'
// import Edu from './components/TOPICS/Edu.js'
// import Space from './components/TOPICS/Space.js'
// import Tech from './Tech'
import {BrowserRouter as Router,Switch,Route} from 'react-router-dom';
import { GlobalStyle } from './globalStyles';
import TechHero from './Tech/Hero';
import SportsHero from './SportsComponents/HeroTwo'
import EduHero from './EduComponents/HeroEdu'
import Ideas from './components/Ideas';
import IdeasTwo from './SportsComponents/IdeasTwo';
import { ideaData } from './components/Ideas/data';
import { SportsIdeaData } from './SportsComponents/IdeasTwo/data';
import { EduIdeaData } from './EduComponents/IdeasEdu/data';



function App() {
    return (
      <>
        < Router>
        <Nav/>
        <Switch>
          <Route path='/' exact component={Home}/>
          <Route path="/Sports">
              <GlobalStyle />
              <SportsHero />
            <Route path="/Sports/Ideas">
              <IdeasTwo heading='DID YOU KNOW ‽' data={SportsIdeaData} />
            </Route>
          </Route>

          <Route path='/Eco' exact component={Eco}/>

          <Route path="/Edu">
              <GlobalStyle />
              <EduHero />
            <Route path="/Edu/Ideas">
              <IdeasTwo heading='DID YOU KNOW ‽' data={EduIdeaData} />
            </Route>
          </Route>

          <Route path='/Space' exact component={Space}/>
          <Route path='/tech'>
          <GlobalStyle />
              <TechHero />
              <Route path="/tech/Ideas">
              <Ideas heading='DID YOU KNOW ‽' data={ideaData} />
            </Route>
              </Route>
        </Switch>
        </Router>
      </>
    );
}

export default App;
